-- This script only contains the table creation statements and does not fully represent the table in the database. Do not use it as a backup.

-- Sequence and defined type
CREATE SEQUENCE IF NOT EXISTS document_id_seq;

-- Table Definition
CREATE TABLE "public"."document" (
    "id" int4 NOT NULL DEFAULT nextval('document_id_seq'::regclass),
    "title" varchar,
    "category_id" int4,
    "created_at" timestamp DEFAULT CURRENT_TIMESTAMP,
    "created_by" int4,
    "updated_by" int4,
    "updated_date" timestamp,
    "current_file_path" varchar,
    "version_number" float8,
    "htmldata" bytea,
    "htmljson" json DEFAULT '[]'::json,
    CONSTRAINT "document_category_fkey" FOREIGN KEY ("category_id") REFERENCES "public"."category"("id"),
    CONSTRAINT "document_created_by_fkey" FOREIGN KEY ("created_by") REFERENCES "public"."user_table"("id"),
    CONSTRAINT "document_updated_by_fkey" FOREIGN KEY ("updated_by") REFERENCES "public"."user_table"("id"),
    PRIMARY KEY ("id")
);

